  [],\n\t\"revision_timestamp\": \"2016-08-08T21:58:17.337459\",\n\t\"name\": \"output-fields-from-the-noaa-wavewatch-iiia-wave-model-monthly-hindcasts-for-2014-04-nodc-access\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NOAA WAVEWATCH IIIu00c2u00ae hindcast
  dataset comprises output fields from the monthly WAVEWATCH IIIu00c2u00ae hindcast
  model runs conducted at the National Centers for Environmental Prediction. Each
  model run produces a collection of files containing gridded fields comprised of
  input and mean wave parameters such as the significant wave height, directions,
  frequencies etc. Once per month, a wave simulation is carried out using restart
  files from the previous month and forced by hindcast wind products for the entire
  month. The resulting output data are transferred to NODC on a monthly basis. NODC
  assembles the series of files into monthly accessions to facilitate archival retention
  and public access. The fields are encoded in the standard GRIdded Binary version
  2 (GRIB2) file format. Wave spectral data summaries are included, as well as detailed
  spectra at selected locations, in tabular text format. Nine different sets of output
  fields, corresponding to nine different grids used in the numerical simulations,
  are included. These include a global grid, as well as regional and coastal grids
  covering much of the North Atlantic and North Pacific oceans.\",\n\t\"license_title\":
